sympy.sympy.external.pythonmpq.__eq__:
def __eq__(self, other):
    """Compare equal with PythonMPQ, int, float, Decimal or Fraction"""
    if isinstance(other, PythonMPQ):
        return (self.numerator == other.numerator
            and self.denominator == other.denominator)
    elif isinstance(other, self._compatible_types):
        return self.__eq__(PythonMPQ(other))
    else:
        return NotImplemented

sympy.sympy.polys.agca.extensions.__eq__:
def __eq__(f, g):
    if isinstance(g, ExtElem):
        return f.rep == g.rep and f.ext == g.ext
    else:
        return NotImplemented

sympy.sympy.polys.domains.gaussiandomain:
def __eq__(self, other) -> bool:
    if isinstance(other, self.__class__):
        return self.x == other.x and self.y == other.y
    else:
        return NotImplemented

sympy.sympy.polys.fields.__eq__:
def __eq__(f, g):
    if isinstance(g, FracElement) and f.field == g.field:
        return f.numer == g.numer and f.denom == g.denom
    else:
        return f.numer == g and f.denom == f.field.ring.one

sympy.sympy.polys.polyclasses.__eq__:
def __eq__(f, g):
    try:
        F, G, _, _ = f.unify_ANP(g)
    except UnificationFailed:
        return NotImplemented
    return F == G

sympy.sympy.polys.puiseux.__eq__:
def __eq__(self, other: object) -> bool:
    if isinstance(other, PuiseuxPoly):
        return (
            self.poly == other.poly
            and self.monom == other.monom
            and self.ns == other.ns
        )
    elif self.monom is None and self.ns is None:
        return self.poly.__eq__(other)
    else:
        return NotImplemented

sympy.sympy.polys.rings.is_element:
def is_element(self, element) -> TypeIs[PolyElement[Er]]:
    """Check if element belongs to this ring."""
    return isinstance(element, PolyElement) and element.ring == self
